import './projects.scss';
import {Container , Row , Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

import Button from './../button/button';

import tyho from './../../assets/projects/tyho.jpg';
import ebenezer from './../../assets/projects/ebenezer.jpg';
import frolik from './../../assets/projects/frolik.jpg';
import illusion from './../../assets/projects/illusion.jpg';
import kaira from './../../assets/projects/kaira.jpg';
import mayans from './../../assets/projects/mayans.jpg';
import onk from './../../assets/projects/onk.jpg';
import miracle from './../../assets/projects/miracle.jpg';
import yogimudra from './../../assets/projects/yogimudra.jpg';
import energy from './../../assets/projects/energy.jpg';

const Projects = () => (
    <div className="project-top container">
        <Container>
            <Row>
            <Col md="6" className="text-right padding">
                 <h1>4 +<h6> Years of <h6>experience</h6></h6></h1>
                 <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Officia facere, quia dolor laudantium labore, ab minus maiores omnis et eum suscipit! A odio architecto repudiandae praesentium accusantium cupiditate nemo dolore?</p>
                 <Button text="Contact" hash="#Contact"/>
                 <br/>
                 <br/>

                 </Col>
                <Col md="6" className="text-center">
                   <Row>
                    <Col md="3" xs="6"><img src={tyho} className="project-images" alt="tyho"/></Col>
                    <Col md="3" xs="6"><img src={illusion} className="project-images" alt="tyho"/></Col>
                    <Col md="3" xs="6"><img src={miracle} className="project-images" alt="tyho"/></Col>
                    <Col md="3" xs="6"><img src={frolik} className="project-images" alt="tyho"/></Col>
                    <Col md="3" xs="6"><img src={onk} className="project-images" alt="tyho"/></Col>
                    <Col md="3" xs="6"><img src={kaira} className="project-images" alt="tyho"/></Col>
                    <Col md="3" xs="6"><img src={mayans} className="project-images" alt="tyho"/></Col>
                    <Col md="3" xs="6"><img src={ebenezer} className="project-images" alt="tyho"/></Col>
                    <Col md="3" xs="6"><img src={yogimudra} className="project-images" alt="tyho"/></Col>
                    <Col md="3" xs="6"><img src={energy} className="project-images" alt="tyho"/></Col>
                   </Row>
                </Col>
            </Row>
        </Container>
    </div>
)

export default Projects;
